    //   method: 'GET',
    // })
    const response = await fetch('http://localhost:5000/test', {
      method: 'GET',
    })
    const data = await response.json()
    console.log(data)
  }

  return (
    <div className="App">
      <button 
        className="button"
        onClick={onSubmitHandler}
      >
        Get Recommendations!
      </button>
    </div>
  );
}

export default App;
